import Link from "next/link";
import styled from "styled-components";
import { ButtonPrimary, ButtonSecondary } from "../Button/Button";
import { Flex } from "../Flex/Flex";
import { Text } from "../Text/Text";

const NavbarOption = styled.a`
  text-decoration: none;
  border: none;
  font-weight: bold;
  line-height: 18px;
  transition: all 350ms;
  max-height: 18px;

  &:hover {
    border-bottom: 2px solid red;
  }
`;

const Navbar = () => (
  <Flex w={1} alignItems="space-between">
    <Text>Elefante</Text>
    <Flex alignItems="center">
      <Flex p={2}>
        <Link href="/">
          <NavbarOption>Home</NavbarOption>
        </Link>
      </Flex>
      <Flex p={2}>
        <Link href="/recursos">
          <NavbarOption>Recursos</NavbarOption>
        </Link>
      </Flex>
      <Flex p={2}>
        <Link href="/precos">
          <NavbarOption>Pre√ßos</NavbarOption>
        </Link>
      </Flex>
      <Flex p={2}>
        <Link href="/about">
          <NavbarOption>Ajuda</NavbarOption>
        </Link>
      </Flex>
    </Flex>
    <Flex>
      <ButtonPrimary>Login</ButtonPrimary>
      <ButtonSecondary>Cadastre-se</ButtonSecondary>
    </Flex>
  </Flex>
);

export default Navbar;
